import React from 'react';

class MyCompponent extends React.Component {
    handleClick = () => {
        console.log('click me')
    }
    render() {
        let name = 'Cong'
        return (
            <>
                <div className='first'>hello {name}</div>
                <div className='secon'>
                    <button onClick={() => this.state.handleClick()}>Click me</button>
                </div>
            </>
        )
    }
}

export default MyCompponent;
